import "./App.css";
import { useState } from "react";
import Axios from "axios";
function App() {
  const [date, setDate] = useState("");
  const [name, setName] = useState("");
  const [size, setSize] = useState(0);

  const [exampleList, setExamplelist] = useState([]);


  const getList = () => {
    Axios.get("http://localhost:3005/history", {

    }).then((response)=>{
      setExamplelist(response.data);
      console.log(response);
    });    
  }

  const addEmployee = () => {
    Axios.post("http://localhost:3005/create", {
      name: name,
      date: date,
      size: size,
    }).then(()=>{
      console.log("success");
    });
  };
  return (
    <div className="App">
      <div className="information">
        <label>Date</label>
        <input
          type="text"
          onChange={(event) => {
            setDate(event.target.value);
          }}
        />
        <label>Food Name</label>
        <input
          type="text"
          onChange={(event) => {
            setName(event.target.value);
          }}
        />
        <label>Serving Size</label>
        <input
          type="number"
          onChange={(event) => {
            setSize(event.target.value);
          }}
        />
        <button onClick={addEmployee}>Add Food Log</button>
      </div>
      ---------------------------------------------------------
      <div className="showInfo">
        <button className="displayHistory" onClick={getList}>show history</button>

        {exampleList.map((val, key) => {
          return <div>
            {val.name}
          </div>
        })}
      </div>
    </div>
  );
}

export default App;
